		if(this.isSingleFrame) {
			return;
		}
		if(this.totalFrames == 1) {
			this.isSingleFrame = true;
		}
		this.stop();
		
		this.yay_mc.visible = false;
		this.refresh_btn.visible = false;
		
		var keepcount = 0;
		
		this.cathair_mc.addEventListener("click", addOne.bind(this));
		this.oldphoto_mc.addEventListener("click", addOne.bind(this));
		this.plantfood_mc.addEventListener("click", addOne.bind(this));
		this.stardust_mc.addEventListener("click", addOne.bind(this));
		this.leaf_mc.addEventListener("click", addOne.bind(this));
		this.apple_mc.addEventListener("click", addOne.bind(this));
		this.teddy_mc.addEventListener("click", addOne.bind(this));
		this.lostring_mc.addEventListener("click", addOne.bind(this));
		this.bluemushroom_mc.addEventListener("click", addOne.bind(this));
		this.unicornhorn_mc.addEventListener("click", addOne.bind(this));
		function addOne(e) {
			e.currentTarget.visible = false;
			if (keepcount == 9){
				this.yay_mc.visible = true;
				this.refresh_btn.visible = true;
				
				}else {
					
				keepcount++;
		}
		this.showscore.text = keepcount;
		}
		
		
		
		this.refresh_btn.addEventListener("click", refreshPage.bind(this));
		
		function refreshPage(){
			location.reload();
			return false;
		}
		
		
		
		this.instruction_mc.visible = false;
		
		this.hint_btn.addEventListener("click", ClickToHide.bind(this));
		
