		function couch_mcF () {
		createjs.Sound.play("yummy");
		}
		
		
		
		this.couch_mc.addEventListener("click", PlayCouch.bind(this));
		
		function PlayCouch(){
			this.couch_mc.gotoAndPlay("PlayCouch");
		}
		
		
		//cat play animation & sound
		
		this.cat_mc.stop();
		
		this.cat_mc.addEventListener("click", cat_mcF);
		
		function cat_mcF () {
		createjs.Sound.play("meow");
		}
		
		
		
		this.cat_mc.addEventListener("click", PlayMeow.bind(this));
		
		function PlayMeow(){
			this.cat_mc.gotoAndPlay("PlayMeow");
		}
		
		
		//Magic drink sound 
		
